(12, 'steam:11000010d6cb762', 'Ella', 'Winham', '8/8/1998', 'Age: 19\n\nAppearance: Snow-White Hair, Pale freckled skin & Cold-Blue eyes. \n\nBirthday: 08/08/1998\n\nFirst Language: English (British)\n\nFavourite Colour: Black & White\n\nFavourite Things: Ocean, Guns, Strawberry Milkshakes, Her Dog (Alfie), Motorbikes.\n\nFamily Members: Mother (Claire Winham) Deceased, Father (Erik Winham) Deceased \n\nPersonality/Attitude: Ella is a very distant and cold individual, recent events have caused her to become slightly insane. At the mention of a single word, her attitude changes instantly from an innocent, dumbfounded child to a heartless cold killer; She very much so acts like a pet or a zombie as some would call it around her previous partner Dante, she follows his every command and does as he orders.  After talking to Nade she hasn''t changed her ways but has more, put on a mask still staying loyal to Dante but protecting herself until she knows his true intentions. After Dante Died she became distant, still holding the mask to her face and pretending she was okay to please others around her.\n\nSkills: Mechanical skills, Drawing, Shooting, Driving\n\nDislikes: Mushrooms, Fish.\n\nStrengths: Shooting, Loyalty, Reliable. \n\nWeaknesses: Overly Emotional, Self-esteem, Verbal Communication. \n\nBackground Story: Ella Grew up in Southern England with her Mother & Father, about two months after her birth her father passed away in a tragic car accident, causing Ella to grow up wondering who her father was; She never knew what happened to her father and never intended to know.  17 years later, Ella signed up for University abroad in America, during this time her mother opened up & revealed what happened to her father; distraught Ella locked herself away like a brooding child till the day she had to leave for University.\n\nWhat happened to cause such a drastic change in El''s personality? She was tortured and manipulated by the one and only Dante Evans, he kidnapped her a